import React, { useState } from "react";



function TaskList(tasks) {
  return(
    <div>
        {tasks.length > 1 ? tasks.map((task) => (
    <div key={task.id}>
      <h3>{task.title}</h3>
      <p>{task.description}</p>
      <p>{task.completed}</p>
      </div>
  )) : <p className="text-notask">No tasks, add a new one!</p> }


    </div>
)
};

export default TaskList;
